//SiteTabs is a component which, when given the properties (config files) for 'websites' within in this application, will display their names and re-direct to the routes in the config files.

import React, { Component } from 'react';

import 'bootstrap/dist/css/bootstrap.css';
import Tab from 'react-bootstrap/Tab';
import Tabs from 'react-bootstrap/Tabs';

import {getColour} from "../config/config-lib";

export default class SiteTabs extends Component {
  render() {
    
    const configData1 = this.props.configData1;

    return (
      <Tabs defaultActiveKey="SITE_1" id="uncontrolled-tab-example" className="mb-3">
        <Tab eventKey="SITE_1" title={configData1.TITLE}>
          {getColour()}
        </Tab>
        <Tab eventKey="SITE_2" title="SITE_NAME_2">
          SITE_2
        </Tab>
        <Tab eventKey="SITE_3" title="SITE_NAME_3" disabled>
          SITE_3
        </Tab>
    </Tabs>
    );
  }
}
